import Box from "@mui/material/Box";
import "./ShowBox.css";
import { useState } from "react";
import RoundBox from "../component/common/RoundBox";

const ShowBox = () => {
  const [side, siedChage] = useState("right");

  return (
    <>
      {side === "left" ? (
        <RoundBox className="Round-box-left" />
      ) : (
        <RoundBox className="Round-box-right" />
      )}

      <Box
        sx={{
          width: "auto",
          height: 500,
          alignItems: "center",
          backgroundColor: "white",
          margin: "auto",
        }}
      ></Box>
    </>
  );
};

export default ShowBox;
